import React, {useEffect, useState } from "react";
import axios from "axios";

function TopCharts(){
    const[topChart , setTopChart] = useState({})
    useEffect(()=>{
        axios.get('http://localhost:8080/topcharts')
        .then((response)=>{
            console.log(response.data['TOP_FREE_APPS'])
            setTopChart(response.data)

        })
    },[])
    return(
        <div className="TopCharts">
            <div className="TopFreeApps">
                {
                    topChart.hasOwnProperty('TOP_FREE_APPS')?topChart['TOP_FREE_APPS'].map((app)=>{
                        <li>app.name</li>
                    }):null
                }
            </div>        
        </div>
    )
}

export default TopCharts
